webpackJsonp([51230231646646],{2080:function(o,r){o.exports={pathContext:{docHtml:'<h1>supports-color <a href="https://travis-ci.org/chalk/supports-color"><img src="https://travis-ci.org/chalk/supports-color.svg?branch=master" alt="Build Status"></a></h1>\n<blockquote>\n<p>Detect whether a terminal supports color</p>\n</blockquote>\n<h2>Install</h2>\n<pre><code>$ npm install --save supports-color\n</code></pre>\n<h2>Usage</h2>\n<pre><code class="language-js">var supportsColor = require(\'supports-color\');\n\nif (supportsColor) {\n    console.log(\'Terminal supports color\');\n}\n</code></pre>\n<p>It obeys the <code>--color</code> and <code>--no-color</code> CLI flags.</p>\n<p>For situations where using <code>--color</code> is not possible, add an environment variable <code>FORCE_COLOR</code> with any value to force color. Trumps <code>--no-color</code>.</p>\n<h2>Related</h2>\n<ul>\n<li><a href="https://github.com/chalk/supports-color-cli">supports-color-cli</a> - CLI for this module</li>\n<li><a href="https://github.com/chalk/chalk">chalk</a> - Terminal string styling done right</li>\n</ul>\n<h2>License</h2>\n<p>MIT Â© <a href="http://sindresorhus.com">Sindre Sorhus</a></p>',docPath:"argo-ci/node_modules/babel-code-frame/node_modules/supports-color/readme",proj:"argo-ci"}}}});
